sections.code:
body, .forumline {
	background-color: #152025 !important;
	color: #ccc !important;
	border: none !important;
}
input, select, .folded, .folded2, .spoiler-body, tbody, .tg, .menutable, th, .top, .rowlightgreen, .spaceRow, input.post, textarea.post {
	background-image: none !important;
	background-color: #253035 !important;
	box-shadow: 0 0 1px #757575 !important;
	border: none !important;
	color: #ccc !important;
}
.thHead, .row1, .row2, .row3, .postbody, .gen, .genmed, .gensmall, table, td.cat, td.catHead, td.catSides, td.catLeft, td.catRight, td.catBottom {
	background-image: none !important;
	background-color: #253035 !important;
	box-shadow: none !important;
	border: none !important;
	color: #ccc !important;	
}
.gen, .mainmenu, .tDL {
	color: #ccc !important;
}
a:link, a:active, a:visited, a.gen, a.genmed, a.gensmall, .nav, .gen, .genmed, .gensmall,.copyright {
	color: #09b !important;
}
a:hover {
    color: #9df !important
}
.seed,.seedmed,.seedsmall{
	color:#090 !important;
}
.seed_bonus,.bonusmed,.bonussmall{
	color:#08d !important;
}
.dlDown, span[style="color: #800000"], .leech,.leechmed,.leechsmall{
	color:#c33 !important;
}
.dlWill{
	color:#069 !important;
}
.name, .postdetails {
	color:#689 !important;
}
.rank_progress_bar .bar {
	background: linear-gradient(to right,  rgba(234,234,234,1) 31%,rgba(174,212,248,1) 57%,rgba(94,184,232,1) 87%) !important;
}
.rank_progress_bar.tit, .rank_progress_bar.tit-b {
	color:#578 !important;
	border: 1px solid #757575 !important;
}
.audioplayer {
	border: none !important;
	margin: 3px !important;
}
.forumline tbody tr .row1, .forumline tbody tr .row3 {
	box-shadow: 0 0 1px #757575 !important;
}
